import React from "react";
import "./App.css";
import { 
    BrowserRouter as Router, 
    Link, 
    Route, 
    Switch 
} from "react-router-dom";

function App() {
    return (
        <div className="App">
            <h1>Belajar Router</h1>

            <Home />
            <About />
            <Users />
        </div>
    );
}

const Home = () => (
    <div>
        <h2>Home</h2>
    </div>
);

const About = () => (
    <div>
        <h2>About</h2>
    </div>
);

const Users = () => (
    <div>
        <h2>Users</h2>
    </div>
);

export default App;
